import React from 'react';

const Calendar = () => {
    const weeks = ['ПН','ВТ','СР','ЧТ','ПТ','СБ','ВС',];
    return (
        <table className="calendar">
            <thead>
                <tr>
                    {weeks.map((name)=>
                        <td key={name} >{name}</td>
                    )}
                </tr>
            </thead>
            <tbody>
                <tr>
                    <td></td>

                </tr>
            </tbody>
        </table>
    );
};

export default Calendar;
